import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { Button, Card, CardContent, Typography, Avatar, Box, Container, Grid } from '@mui/material';
import { styled } from '@mui/system';

// Styled components using Material UI
const StyledCard = styled(Card)({
  background: '#fff',
  borderRadius: '15px',
  boxShadow: '0 4px 12px rgba(0, 0, 0, 0.1)',
  transition: 'transform 0.3s ease, box-shadow 0.3s ease',
  cursor: 'pointer',
  '&:hover': {
    transform: 'scale(1.05)',
    boxShadow: '0 6px 15px rgba(0, 0, 0, 0.2)',
  },
});

const Dashboard = () => {
  const navigate = useNavigate();
 const [data, setData] = useState({
    name:" ",
    email: '',
    profilePicture: 'https://via.placeholder.com/40', // Placeholder image
  });

  // Handlers for navigation
  const handleViewClubs = () => navigate('/clubs');
  const handleViewEvents = () => navigate('/events');
  const handleViewResources = () => navigate('/resources');
  const handleDeleteAccount = () => navigate('/delete-account');
  const handleLogout = () => navigate('/logout');

  return (
    <Box sx={styles.container}>
      {/* Top-right user info and actions */}
      <Box sx={styles.topRightContainer}>
        <Box sx={styles.userInfoContainer}>
          <Avatar src={userInfo.profilePicture} alt="Profile" sx={styles.profilePicture} />
          <Typography sx={styles.username}>{userInfo.username}</Typography>
        </Box>
        <Box sx={styles.actionsContainer}>
          <Button variant="contained" color="error" sx={styles.deleteAccountButton} onClick={handleDeleteAccount}>
            Delete Account
          </Button>
          <Button variant="contained" color="secondary" sx={styles.logoutButton} onClick={handleLogout}>
            Logout
          </Button>
        </Box>
      </Box>

      {/* Main Header */}
      <Box sx={styles.header}>
        <Typography variant="h4" sx={styles.headerTitle}>
          Welcome to Your Dashboard
        </Typography>
      </Box>

      {/* Main Content (Cards for Clubs, Events, Resources) */}
      <Container sx={styles.contentContainer}>
        <Grid container spacing={4} justifyContent="center">
          <Grid item xs={12} sm={4}>
            <StyledCard onClick={handleViewClubs}>
              <CardContent sx={styles.cardContent}>
                <Typography variant="h6" sx={styles.cardTitle}>Clubs</Typography>
                <Typography sx={styles.cardDescription}>Manage and view all your clubs.</Typography>
              </CardContent>
            </StyledCard>
          </Grid>
          <Grid item xs={12} sm={4}>
            <StyledCard onClick={handleViewEvents}>
              <CardContent sx={styles.cardContent}>
                <Typography variant="h6" sx={styles.cardTitle}>Events</Typography>
                <Typography sx={styles.cardDescription}>Browse and enroll in upcoming events.</Typography>
              </CardContent>
            </StyledCard>
          </Grid>
          <Grid item xs={12} sm={4}>
            <StyledCard onClick={handleViewResources}>
              <CardContent sx={styles.cardContent}>
                <Typography variant="h6" sx={styles.cardTitle}>Resources</Typography>
                <Typography sx={styles.cardDescription}>Access shared resources and materials.</Typography>
              </CardContent>
            </StyledCard>
          </Grid>
        </Grid>
      </Container>

      {/* Footer */}
      <Box sx={styles.footer}>
        <Typography sx={styles.footerText}>Â© 2024 Your Company. All rights reserved.</Typography>
      </Box>
    </Box>
  );
};

const styles = {
  container: {
    display: 'flex',
    flexDirection: 'column',
    minHeight: '100vh',
    background: 'linear-gradient(135deg, #f0f4f8, #d9e2f3)',
    fontFamily: "'Segoe UI', Tahoma, Geneva, Verdana, sans-serif",
    paddingTop: '90px', // Extra space for header
    boxSizing: 'border-box',
  },
  topRightContainer: {
    position: 'absolute',
    top: '20px',
    right: '20px',
    display: 'flex',
    alignItems: 'center',
    gap: '20px',
    zIndex: 10,
  },
  userInfoContainer: {
    display: 'flex',
    alignItems: 'center',
    gap: '15px',
  },
  profilePicture: {
    width: '40px',
    height: '40px',
    borderRadius: '50%',
    objectFit: 'cover',
  },
  username: {
    fontSize: '18px',
    fontWeight: '600',
    color: '#2c3e50',
  },
  actionsContainer: {
    display: 'flex',
    gap: '15px',
  },
  deleteAccountButton: {
    padding: '12px 20px',
    borderRadius: '30px',
    fontSize: '15px',
    boxShadow: '0 4px 6px rgba(0, 0, 0, 0.2)',
    '&:hover': {
      backgroundColor: '#e74c3c',
      boxShadow: '0 6px 12px rgba(0, 0, 0, 0.3)',
    },
  },
  logoutButton: {
    padding: '12px 20px',
    borderRadius: '30px',
    fontSize: '15px',
    boxShadow: '0 4px 6px rgba(0, 0, 0, 0.2)',
    '&:hover': {
      backgroundColor: '#7f8c8d',
      boxShadow: '0 6px 12px rgba(0, 0, 0, 0.3)',
    },
  },
  header: {
    backgroundColor: '#3498db',
    color: '#fff',
    padding: '60px 20px',
    textAlign: 'center',
    boxShadow: '0 2px 5px rgba(0, 0, 0, 0.1)',
    marginBottom: '40px',
    borderBottomLeftRadius: '25px',
    borderBottomRightRadius: '25px',
  },
  headerTitle: {
    margin: 0,
    fontSize: '35px',
    fontWeight: '600',
  },
  contentContainer: {
    padding: '50px 20px',
  },
  cardContent: {
    textAlign: 'center',
  },
  cardTitle: {
    fontSize: '22px',
    fontWeight: '600',
    color: '#2c3e50',
  },
  cardDescription: {
    fontSize: '16px',
    color: '#7f8c8d',
    marginTop: '12px',
  },
  footer: {
    backgroundColor: '#2c3e50',
    color: '#fff',
    textAlign: 'center',
    padding: '20px 0',
    position: 'absolute',
    bottom: '0',
    width: '100%',
    borderTopLeftRadius: '25px',
    borderTopRightRadius: '25px',
  },
  footerText: {
    margin: 0,
    fontSize: '14px',
  },
};

export default Dashboard;
